import React from "react";
// reactstrap components
import {
    Button,
    Card,
    CardImg,
    CardHeader,
    CardBody,
    CardTitle,
    Container ,
    Row,
    Col
} from "reactstrap";

class Login extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            bigChartData: "data1"
        };
    }
    render() {
        return (
            <>
            <Container fluid>
            <Row>
                <Col md='5' p-0 >
             <Card heigth="100%">
             <CardImg  src={require("assets/img/theme/auth.png")}>
            </CardImg>
             </Card>
             </Col>
             <Col md='7' p-0>
             </Col>
            </Row>
           </Container>
            </>
        );
    }
}
export default Login;
